【ネムカットの詳細】<br>●仕事・勉強・ドライブに。<br>●カフェイン＆4つのエキスで眠気スッキリ！気分爽快！<br>●レモンジンジャー味。<br><br>【詳細】<br>●名称：清涼飲料水<br>●原材料名：果糖ブドウ糖液糖、白糖、ナルコユリ抽出液、エゾコウギ抽出液、ショウガエキス、トウガラシ抽出液、酸味料、カフェイン（抽出物）、保存料（安息香酸Na、ブチルパラベン）、甘味料（スクラロース）、ビタミンB1、ビタミンB6、香料<br>●内容量：100ml×6本<br>●賞味期限：パッケージに記載<br>●保存方法：高温・多湿及び直射日光を避けて保存してください。<br><br>【栄養成分表示】100mlあたり<br>エネルギー：42kcal、炭水化物：9.9g、タンパク質：0.3g、ナトリウム：32.6mg、脂質：0g、カフェイン：120mg<br><br>【ご注意】<br>○カフェインが含まれていますので、妊婦、小児、体調のすぐれない方、カフェインや辛味に敏感な方は飲用をさけてください。<br>○空腹時には飲用をさけてください。<br>○1日1本を目安に、多量の飲用をさけてください。<br>○体質にあわないと思われるときは飲用しないでください。<br>○原料由来（エキス類）の沈殿が生じることがありますが、品質には問題ありません。よく振ってからお飲みください。<br>○開栓後はすぐにお飲みください。<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>株式会社富士薬品<br>埼玉県さいたま市大宮区桜木町4丁目383番地<br>048-648-1118<br><br>【商品区分】<br>食品<br><br>［カフェイン飲料］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
