【組成・性状】<br>
●ホウ砂 (Na2B4O7・10H2O) 99.0～103.0%を含有します。<br>
●無色若しくは白色の結晶又は白色の結晶性の粉末で、においはありません。<br>
●乾燥空気中に放置するとき、風解し、白色の粉末で覆われます。<br><br>

【ご注意】<br>
○使用する場合は、こぼれたりしないように注意し、換気を十分に行なって下さい。
○飲まないで下さい。<br>
○使用期限を過ぎた製品は使用しないで下さい。<br>
○直射日光の当たらない涼しい所に保管して下さい。<br>
○小児の手の届かない所に保管して下さい。<br>
○他の容器に入れ替えないで下さい。(誤用の原因になったり、品質が変わることがあります。)<br>
○気密容器。室温保存。<br>
○皮ふについた場合には、水で洗い流して下さい。<br>
○万一、飲み込んだ場合は、水を飲ませて吐かせる等の処置をして医師の手当てを受けて下さい。<br><br>

【内容量】<br>
500g<br><br>

